import { Table } from 'antd';
import type { TableProps } from 'antd';
import { useSelector } from 'react-redux';
import { RootState } from '../Redux/store';
import { useEffect, useState } from 'react';

interface DataType {
  address: string;
  area: number | null;
  contain: number | null;
  table: number | null;
  sesion: number | null;
  day: number | null;
}

const columns: TableProps<DataType>['columns'] = [
  {
    title: 'Vị trí',
    dataIndex: 'address',
    rowScope: 'row',
  },
  {
    title: 'Diện tích',
    dataIndex: 'area',
    rowScope: 'row',
  },
  {
    title: 'Xếp theo kiểu rạp hát',
    dataIndex: 'contain',
    rowScope: 'row',
  },
  {
    title: 'Công suất phòng',
    children: [
      {
        title: 'Xếp theo kiểu bàn tròn (10 khách/bàn)',
        dataIndex: 'table',
        rowScope: 'row',
      },
      {
        title: 'Xếp theo kiểu bàn tròn (10 khách/bàn)',
        dataIndex: 'table',
        rowScope: 'row',
      },
    ],
  },
  {
    title: 'Nữa ngày (VNĐ)',
    dataIndex: 'sesion',
    rowScope: 'row',
  },
  {
    title: 'Nguyên ngày (VNĐ)',
    dataIndex: 'day',
    rowScope: 'row',
  },
  {
    title: 'Ghi chú',
    rowScope: 'row',
  },
  {
    title: 'test',
  },
];


function RoomPrice() {

  const room = useSelector((state: RootState) => state.room.val);
  const note = useSelector((state: RootState) => state.room.note);

  const [data, setData] = useState<DataType[]>([]);

  useEffect(() => {
    console.log(room);
    setData(room);
  }, []);

  return (<>
    <Table <DataType> columns={columns} dataSource={data} bordered />
  </>);
}
export default RoomPrice;
